        div.wide.grid
          div.announcement-photo.start-2.span-10.span-6-medium-plus(:style='{backgroundPosition: "center", backgroundSize: "cover", backgroundColor: "#fff",backgroundImage: "url(" + slide.image + ")"}')
          div.start-2.span-10.start-9-medium-plus.span-3-medium-plus.padding
            h2.text-left {{ slide.title }}
            br
            p.text-left(style="font-size: 1.4rem") {{ slide.subtitle }}

  section.padding-large.why-choose-us
    center
      div(style="width: 80%")
        h1.margin-bottom-large Why choose us?
        p(style="font-size: 1.5rem") Remember Them Little knows that childhood is a precious yet fleeting moment in everyone's lives because it is a time of learning and happiness but it only comes once and it goes away fast! We here at RTL aim to capture those precious moments of your little ones in perfect stillness so they can become memorable for you and your family. Whether your child is a boy or a girl, a baby or a toddler or maybe even still in mommy's womb, we got the perfect tools to help you find the right setting and write the perfect plot for the little fairytale that is your child's years of youth.

